import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  border: 1px solid #fff;
  border-radius: 20px;
  color: #fff;
  display: flex;
  flex-direction: row;
`;

export default function NavBarItem(props) {
  return (
    <Div>
      <i class={props.icon}></i>
      <p>{props.type}</p>
    </Div>
  );
}
